CREATE DEFINER=`root`@`localhost` PROCEDURE `import_homology_data`(human_gene_symbol varchar(30), human_chromosome varchar(15), human_start int, human_stop int, 
mouse_gene_symbol varchar(30), mouse_chromosome varchar(15), mouse_start int, mouse_stop int, homology_type varchar(25), confidence_score tinyint)
BEGIN
	DECLARE human_gene_id_var int DEFAULT null;
    DECLARE mouse_gene_id_var int DEFAULT null;
    DECLARE homology_type_id_var int DEFAULT null;
    DECLARE human_chromosome_scaffold_id_var int DEFAULT null;
    DECLARE mouse_chromosome_scaffold_id_var int DEFAULT null;
    
    SELECT id INTO human_gene_id_var FROM human_genes WHERE gene_symbol = human_gene_symbol;
    SELECT id INTO mouse_gene_id_var FROM mouse_genes WHERE gene_symbol = mouse_gene_symbol;
    SELECT id INTO homology_type_id_var FROM homology_types WHERE name = homology_type;
    
    
    SELECT id INTO human_chromosome_scaffold_id_var FROM chromosomes WHERE name = human_chromosome;
	IF isnull(human_chromosome_scaffold_id_var) THEN
		INSERT INTO chromosomes (name) VALUES (human_chromosome);
        SELECT LAST_INSERT_ID() INTO human_chromosome_scaffold_id_var;
	END IF;
    
    SELECT id INTO mouse_chromosome_scaffold_id_var FROM chromosomes WHERE name = mouse_chromosome;
	IF isnull(mouse_chromosome_scaffold_id_var) THEN
		INSERT INTO chromosomes (name) VALUES (mouse_chromosome);
        SELECT LAST_INSERT_ID() INTO mouse_chromosome_scaffold_id_var;
	END IF;
    
	IF isnull(human_gene_id_var) THEN
		INSERT INTO human_genes (gene_symbol, chromosome_id, start, stop) 
			VALUES (human_gene_symbol, (SELECT id FROM chromosomes WHERE name = human_chromosome), human_start, human_stop);
        SELECT LAST_INSERT_ID() INTO human_gene_id_var;
    END IF;
    
    IF isnull(mouse_gene_id_var) THEN
		INSERT INTO mouse_genes (gene_symbol, chromosome_id, start, stop) 
			VALUES (mouse_gene_symbol, (SELECT id FROM chromosomes WHERE name = mouse_chromosome), mouse_start, mouse_stop);
        SELECT LAST_INSERT_ID() INTO mouse_gene_id_var;
	END IF;
    
	IF isnull(homology_type_id_var) THEN
		INSERT INTO homology_types (name) VALUES (homology_type);
        SELECT LAST_INSERT_ID() INTO homology_type_id_var;
	END IF;
    
    INSERT INTO homologs (human_gene_id, mouse_gene_id, homology_type_id, confidence) VALUES (human_gene_id_var, mouse_gene_id_var, homology_type_id_var, confidence_score);
