CREATE DEFINER=`root`@`localhost` PROCEDURE `search_by_term_label`(
	IN `term_label` VARCHAR(400),
	IN `page_num` INT,
	IN `display_limit` INT
)
BEGIN
	DECLARE offset_count INT;
	SET offset_count = (page_num - 1) * display_limit;
    IF (display_limit = 0) THEN
		SELECT COUNT(*) AS Total
		FROM (
			SELECT mp.mp_term_id, mp.term_name, COUNT(ex.experiments_id) AS experiment_count, MATCH(mp.term_name) AGAINST (term_label IN BOOLEAN MODE) AS Score
				FROM mp_phenotypes AS mp
		        INNER JOIN experiment_phenotypes AS exp ON exp.phenotype_id = mp.mp_phenotype_id
		        INNER JOIN experiments AS ex ON ex.experiments_id = exp.experiment_id
                WHERE MATCH(mp.term_name) AGAINST (term_label IN BOOLEAN MODE) >= 0.9
		        GROUP BY mp.mp_term_id
				ORDER BY Score DESC
		  	) AS result;
	ELSE
		SELECT result.mp_term_id AS 'Mammalian Phenotype Ontology ID', result.term_name AS 'Ontology Term', result.experiment_count AS 'Mouse Knockouts'
		FROM (
			SELECT mp.mp_term_id, mp.term_name, COUNT(ex.experiments_id) AS experiment_count, MATCH(mp.term_name) AGAINST (term_label IN BOOLEAN MODE) AS Score
				FROM mp_phenotypes AS mp
		        INNER JOIN experiment_phenotypes AS exp ON exp.phenotype_id = mp.mp_phenotype_id
		        INNER JOIN experiments AS ex ON ex.experiments_id = exp.experiment_id
		        GROUP BY mp.mp_term_id
				  ORDER BY Score DESC
				  LIMIT display_limit
				  OFFSET offset_count
		  	) AS result
		WHERE result.Score >= 0.9;
    END IF;

END ;;
